import Navbar from './Navbar.js';
import About from './About.js';

function App() {
    return (
        <div className="App">

            <Navbar/>

            <h1 class="heading">CSC 648 - Software Engineering</h1>
            <h2 class="heading">Section 4</h2>
            <h3 class="heading">Team 02</h3>

            <About/>
        </div>
    );
}

export default App;
